import React, { ReactElement, useState } from 'react';



const Navbar = () => {
    const menuLst = ["Search", "About", "Refer"];
    const [hide, setHide] = useState({
        Search: false,
        About: false,
        Refer: false,
      });

    const mouseEvent = ( menuName, bool) => {
        const change = { ...hide };
        change[menuName] = bool;
        setHide(change);
    };




    return (
        <nav className="nav">
            {/* Home 제목 */}
        <a href="/" className="site-title">
            Konfold
        </a>
        {/* 대 메뉴  */}

        <ul className="navContainer">



            <li>
                <a href="/Search">Search</a>
            </li>
            <li>
                <a href="/About">About</a>
            </li>
            {menuLst.map((v, idx) => (
            <li  className={hide[v] ? "active" : "none"}
            onMouseEnter={() => mouseEvent(v, true)}
            onMouseLeave={() => mouseEvent(v, false)}>
                <a href="/Refer">Reference</a>

            </li>
        ))}
        </ul>
        <div className="detailMenu">
        {menuLst.map((v, idx) => (
          <ul
            onMouseEnter={() => mouseEvent(v, true)}
            onMouseLeave={() => mouseEvent(v, false)}
          >
            <li>{`메뉴${idx + 1}-${1}`}</li>
            <li>{`메뉴${idx + 1}-${2}`}</li>
            <li>{`메뉴${idx + 1}-${3}`}</li>
            <li>{`메뉴${idx + 1}-${4}`}</li>
          </ul>
        ))}
      </div>

    </nav>
    );
};

export default Navbar;

